//  o método Math.min() retorna o menor valor
//  o método Math.max() retorna o maior valor

let a = Math.min(5, 10);
let b = Math.min(16, 150, 30, 20, 38);
let c = Math.min(-5, 10);
let d = Math.min(-5, -10); // ele entende que -10 é menor que -5
let e = Math.min(1.5, 2.5);

let f = Math.max(5, 10);
let g = Math.max(0, 50, 30, 20, 38);
let h = Math.max(-5, 10);
let i = Math.max(-5, -10);

console.log(a,b,c,d,e)  
console.log(f,g,h,i)

